			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/bash;
			shellScript = "# We have work to do if we bundle our own copy of Python.\nif [ -n \"${REGINA_PYTHON_FRAMEWORK}\" ]; then\n  fwDir=\"${CONFIGURATION_BUILD_DIR}\"/Regina.app/Contents/Frameworks/${REGINA_PYTHON_FRAMEWORK}.framework\n  version=`readlink \"$fwDir\"/Versions/Current`\n  versionPath=\"$fwDir/Versions/$version\"\n  \n  # Sanity checks:\n  if [ ! -e \"$versionPath/${REGINA_PYTHON_FRAMEWORK}\" ]; then\n    echo \"ERROR: Missing framework library from $versionPath\"\n    exit 1\n  fi\n  if [ ! -d \"$versionPath/Resources/Python.app\" ]; then\n    echo \"ERROR: Missing Python.app from $versionPath\"\n    exit 1\n  fi\n  \n  # Remove any *unwanted* Python versions:\n  for i in `find \"$fwDir/Versions\" -depth 1 -type d | sed -e 's#.*/##'`; do\n    case \"$i\" in\n      \"$version\" )\n        # Keep this version\n        ;;\n      3.* )\n        # Delete this version\n        echo \"Removing unused Python version $i...\"\n        rm -rf \"$fwDir/Versions/$i\"\n        ;;\n      * )\n        echo \"ERROR: Unexpected Python version: $i\"\n        exit 1\n        ;;\n    esac\n  done\n  \n  # Remove the broken symlink to headers that Xcode removed.\n  if [ -d \"$versionPath\"/include ]; then\n    rm \"$versionPath\"/include/python$version\n    rmdir \"$versionPath\"/include\n  fi\n  \n  # Change the Python bundle IDs to be specific to Regina.\n  plutil -replace CFBundleIdentifier -string net.sourceforge.regina.Python \"$versionPath\"/Resources/Info.plist\n  plutil -replace CFBundleIdentifier -string net.sourceforge.regina.Python \"$versionPath\"/Resources/Python.app/Contents/Info.plist\n  \n  # From here on we re-sign *everything* with our own signature,\n  # inside-out, one file at a time.\n  /usr/bin/codesign --force \\\n    --sign 'Apple Development:' \\\n    --preserve-metadata=entitlements \\\n    --timestamp=none \\\n    \"$versionPath\"/${REGINA_PYTHON_FRAMEWORK}\n\n  # Executables need hardened runtime (for website distribution)\n  # and sandboxing (for App Store distribution).\n  for i in bin/python$version Resources/Python.app/Contents/MacOS/Python; do\n    file=\"$versionPath\"/$i\n    /usr/bin/codesign --force \\\n      --sign 'Apple Development:' \\\n      --prefix net.sourceforge.regina.py. \\\n      --entitlements \"${SRCROOT}\"/python/bundle/Python.entitlements \\\n      --options runtime \\\n      --timestamp=none \\\n      \"$file\"\n  done\n  \n  for file in \"$versionPath\"/lib/python$version/lib-dynload/*.so; do\n    /usr/bin/codesign --force \\\n      --sign 'Apple Development:' \\\n      --preserve-metadata=identifier,entitlements \\\n      --timestamp=none \\\n      \"$file\"\n  done\n  \n  # Strip out some problematic things if we are sandboxed:\n  if ( grep sandbox \"${SRCROOT}\"/python/bundle/Python.entitlements >/dev/null ); then\n    # .../bin/pythonX.Y will crash. We don't need it anyway, and we\n    # shouldn't pretend to offer the user a generic python that is sandboxed.\n    if [ -d \"$versionPath\"/bin ]; then\n      rm \"$versionPath\"/bin/python*\n      rm \"$versionPath\"/bin/pydoc*\n      rm \"$versionPath\"/bin/2to3*\n      rmdir \"$versionPath\"/bin\n    fi\n    \n    # Remove modules that contain \"private API calls\" that Apple disallows:\n    rm -f \"$versionPath\"/lib/python$version/lib-dynload/_curses.*\n    rm -f \"$versionPath\"/lib/python$version/lib-dynload/_curses_panel.*\n    rm -f \"$versionPath\"/lib/python$version/lib-dynload/_tkinter.*\n    rm -f \"$versionPath\"/lib/python$version/lib-dynload/_lzma.*\n    rm -rf \"$versionPath\"/lib/python$version/curses\n    rm -rf \"$versionPath\"/lib/python$version/tkinter\n    rm -f \"$versionPath\"/lib/python$version/lzma.py\n    \n    # Remove SSL so we are not exporting encryption:\n    rm -f \"$versionPath\"/lib/python$version/lib-dynload/_ssl.*\n    rm -f \"$versionPath\"/lib/python$version/lib-dynload/_hashlib.*\n    rm -f \"$versionPath\"/lib/python$version/ssl.py\n    rm -f \"$versionPath\"/lib/python$version/hashlib.py\n    \n    # Remove readline, which locks up in a sandboxed environment:\n    rm -f \"$versionPath\"/lib/python$version/lib-dynload/readline.*\n  fi\n\n  /usr/bin/codesign --force \\\n    --sign 'Apple Development:' \\\n    --options runtime \\\n    --preserve-metadata=entitlements \\\n    --timestamp=none \\\n    \"$versionPath\"/Resources/Python.app\n  /usr/bin/codesign --force \\\n    --sign 'Apple Development:' \\\n    --preserve-metadata=entitlements \\\n    --timestamp=none \\\n    \"$versionPath\"\nfi\n";
		};
